import React from "react";

interface Props {
  width?: string;
  height?: string;
}

/**
 * An AffinityPhotoIcon React Component.
 * @author Jannik Will
 * @version 0.1
 */
const AffinityPhotoIcon: React.FC<Props> = ({ width, height }) => {
  return (
    <img
      width={width}
      height={height}
      src="data:image/png;base64,"
    />
  );
};

export default AffinityPhotoIcon;
